        <figure class=""stand_out"">

            <h3 class=""medium_heading""> II. OBJECTIFS PEDAGOGIQUES </h3>

            <div class=""sub_stand_out"">
                <h3 class=""small_heading""> II. 1. Origine du programme </h3>
                <p class=""description""> 
                    L’évolution actuelle des entreprises dans un environnement concurrentiel très acharné n’est plus à démontrer. Ainsi, la communication se donne une place
                    primordiale dans toute entreprise moderne vue qu’elle est le maillon essentiel qui assure la bonne visibilité de l’entreprise et veille quotidiennement sur la
                    concurrence du marché dans lequel elle évolue. Ces deux éléments étant indispensables de nos jours pour la bonne marche de toute entreprise nationale et
                    internationale, il est indéniable pour ");
            WriteLiteral(@"nous, d’inclure un programme consistant de communication d’entreprise, basé surtout sur le besoin actuel des entreprises.
                    Le programme de formation consiste à mettre à leurs dispositions, des futurs cadres en communication pétris des compétences inégalées.
                </p>
            </div>

            <div class=""sub_stand_out"">
                <h3 class=""small_heading""> II. 2. Objectifs du programme </h3>
                <h3 class=""smaller_heading""> II.2.1. Objectif général </h3>
                <p class=""description""> 
                    L’objectif de ce programme est de former des diplômés polyvalents dans les métiers de la communication média et en entreprise ayant en
                    particulier de solides connaissances dans le domaine de communication. À la fin de ce programme, les diplômés seront en mesure de mettre à
                    profit les compétences acquises dans différentes agences de communication ; et aussi assister et accompagner les entreprises ");
            WriteLiteral(@"dans leur campagne
                    de communication. 	
                                            
                </p>

                <h3 class=""smaller_heading""> II.2.2. Objectifs spécifiques </h3>
                <p class=""description""> 
                    <strong> Commun à la mention </strong><br/>
                    L’apprenant, à l’issue de ce programme sera capable de : <br/>
                </p>
                <ul class=""one_list"">
                    <li> Assister et Accompagner l'entreprise dans la maîtrise de ses enjeux de communication ; </li>
                    <li> Travailler auprès des agences de communication ; des entreprises et des médias publics & privés ; </li>
                    <li> Elaborer des budgets prévisionnels relatifs à la communication ; </li>
                    <li> Occuper un poste de responsable marketing ; d’attaché de presse ; </li>
                </ul>

                <h3 class=""small_heading""> II.3. Approche du programme </h3>
            ");
            WriteLiteral(@"    <p class=""description""> 
